 import { ErrorMessage, Field, Formik } from "formik";
import { useParams, useNavigate } from "react-router-dom";
// import { useAuth } from "./security/AuthContext";
import { useEffect, useState } from "react";
import { AddNewFlightAPI } from "../api/CallingApi";

export default function AddNewFlight() {
    // const authContext = useAuth();
    const navigate = useNavigate();
    const { id } = useParams();

    

const [initialValues, setInitialValues] = useState({
        departureFrom: "",
        arrivalTo: "",
        departure: "",
        returnDate: "",
        seatsAvailable: ""
    });

    // useEffect(() => {
    //     const retrieveStudent = async () => {
    //         if (id && id !== "-1") {
    //             try {
    //                 const response = await retrieveAStudentById(id);
    //                 setInitialValues({
    //                     username: response.data.username || "",
    //                     branch: response.data.branch || "",
    //                     rollNo: response.data.rollNo || "",
    //                     semester: response.data.semester || "",
    //                     admission: response.data.admission || ""
    //                 });
    //             } catch (error) {
    //                 console.log(error);
    //             }
    //         }
    //     };
    //     retrieveStudent();
    // }, [id])
  

    function onSubmit(values) {
        console.log(values);

        const flight = {
            id: id,
            departureFrom: values.departureFrom,  // Use the edited username from Formik
            arrivalTo: values.arrivalTo,
            departure: values.departure.dat,
            returnDate: values.returnDate,
            seatsAvailable: values.seatsAvailable
        };
        
        if(id==-1){

            AddNewFlightAPI(flight)  // Pass the edited username
            .then(response => {
                console.log(response);
                navigate("/successpage");
            })
            .catch(error => console.log(error));
        }else{

            //  UpdatedStudentAPI(id,student)
            //            .then(response =>{
            //                console.log(response.data.username)
            //                navigate("/successpage");
            //             //    Setstudentname(response.data.username)

            //             })
            //             .catch( error =>console.log(error))
        }
    }
 
    function validate(values) {
        let errors = {};

        if (!values.departureFrom) {
            errors.departureFrom = "departureFrom is required";
        }
        if (!values.arrivalTo) {
            errors.arrivalTo = "Enter arrivalTo";
        }
        if (!values.departure) {
            errors.departure = "Enter a valid departure";
        }
        
        return errors;
    }

    return (
        <div>
            <div>
                <Formik
                    initialValues ={initialValues}
                    enableReinitialize={true}
                    onSubmit={onSubmit}
                    validate={validate}
                    validateOnBlur={false}
                    validateOnChange={false}
                >
                    {(props) => (
                        <form onSubmit={props.handleSubmit}>
                            {/* Username Field (Now Editable) */}
                            <ErrorMessage
                                name="departureFrom"
                                component="div"
                                className="alert alert-warning"
                            />
                            <fieldset className="form-group">
                                <label>departureFrom</label>
                                <Field 
                                    type="text" 
                                    className="form-control" 
                                    name="departureFrom"
                                />
                            </fieldset>

                            {/* Other Fields */}
                            <ErrorMessage
                                name="arrivalTo"
                                component="div"
                                className="alert alert-warning"
                            />
                            <ErrorMessage
                                name="departure"
                                component="div"
                                className="alert alert-warning"
                            />
                            <fieldset className="form-group">
                                <label>arrivalTo</label>
                                <Field 
                                    type="text" 
                                    className="form-control" 
                                    name="arrivalTo" 
                                />
                            </fieldset>
                            <fieldset className="form-group">
                                <label>departure</label>
                                <Field 
                                    type="text" 
                                    className="form-control" 
                                    name="departure" 
                                />
                            </fieldset>
                            <fieldset className="form-group">
                                <label>returnDate</label>
                                <Field 
                                    type="number" 
                                    className="form-control" 
                                    name="returnDate" 
                                />
                            </fieldset>
                            <fieldset className="form-group">
                                <label>seatsAvailable</label>
                                <Field 
                                    type="text" 
                                    className="form-control" 
                                    name="seatsAvailable" 
                                />
                            </fieldset>
                            <button className="btn btn-success" type="submit">
                                Save
                            </button>
                        </form>
                    )}
                </Formik>
            </div>
        </div>
    );
}
